Real World: Philadelphia | Shavonda:

FULL BIOGRAPHY 
Shavonda is a beautiful African American young woman who is the life of the party and loves attention from guys. In high school, Shavonda was a cheerleader and her school&amp;#039;s first African American homecoming queen. Shavonda struggles to support herself without any family aid and is putting herself through Grossmont Community College. Shavonda currently has a boyfriend to whom she wants to be faithful, even though he is not the kind of jock that usually pursues her. She likes a jock with a sense of humor and likes to be pursued. As a result of a turbulent childhood, Shavonda generally hopes for the best, but expects the worst. 
